import { useState } from "react"

export function Loading(){
    const [load,set_load]=useState('.')
    useState(()=>{
        var timer=setInterval(() => {
            set_load(''+'.')
            if(load==='loading.......'){
                clearInterval(timer)
            }
        },300);

    })
    return(
        <div>
            loading{load}
        </div>
    )
}
